import React from 'react';
import '../style/tarea-formulario.css';

function TareaFormulario(props) {
  return (
    <form className='tarea-formulario'>
      <input
        className='tarea-input'
        type='text'
        placeholder='Escribe una tarea'
        name='texto'
      />
      <button className='tarea-boton'>
        Agregar Tarea
      </button>
    </form>
  );
}
